import React from 'react';
import SectionTitle from "../../UI/SectionTitle";

import teamBg from '../../../assets/img/team/team-bg-2.webp'
import teamData from '../../../data/Team/home-two'
import TeamMember from "./member";

const Team = () => {
    return (
        <div className="team-area bg-brand">
            <div className="row no-gutters align-items-center">
                <div className="col-xl-4">
                    <div className="team-area-left text-center text-md-left">
                        <SectionTitle
                            variant="light"
                            title="Dịch vụ khác"
                            heading="Hỗ trợ doanh nghiệp <br />hoạt động hiệu quả"
                            text="<strong>Legalbiz</strong> luôn sát cánh cùng doanh nghiệp trong quá trình hoạt động với những tư vấn tiếp theo mà doanh nghiệp thường gặp vướng mắc như: chữ ký số, BHXH, mã vạch sản phẩm, hóa đơn điện tử, ..."
                        />
                    </div>
                </div>

                <div className="col-xl-8">
                    <div className="team-area-right team-area-right--2 bg-img" style={{backgroundImage:`url(${teamBg})`}}>
                        <div className="row no-gutters align-items-end mtn-40">
                             
                            {
                                teamData.map(member => (
                                    <TeamMember key={member.id} id={member.id} profilePic={member.profilePic} name={member.name} designation={member.designation} />
                                ))
                            } 
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Team;
